import React from "react";
import "../styles/editor.scss"

export default function Editor() {
    return (
    <div id="editor">
        <h1>Pixel Editor</h1>
        <h2>Enter Panel Dimensions</h2>
        <div id="options"></div>
        <div className="option">
            <input 
                type="number" 
                className="panelInput" 
                defaultValue="16" 
                // onChange={}
            ></input>
            <span>Width</span>
        </div>
        <div className="option">
            <input 
                type="number" 
                className="panelInput" 
                defaultValue="16" 
                // onChange={}
            ></input>
            <span>Height</span>
        </div>
        <button className="button">Start Drawing</button>
    </div>
    );

}
